import React from "react";
import './Timeline.css'; 

const Timeline = () => {
  return (
    <section className="section-primary" id="timelinesection">
      <div className="container">
        <div className="row">
          <div className="col-md-12 section-heading">
            <h2>Experience</h2>
            <p className="lead" style={{ textAlign: 'center' }}>
            <a 
                href="path-to-your-resume.pdf" 
                download="YourResume.pdf" 
                className="resume-download"
            >
                Resume
            </a>
            </p>
            <hr className="white" />
          </div>
        </div>
        <div className="row flashcard-grid">
          {[
            {
                title: "Kaylie.AI",
                details: "Developed and maintained a web application for Kaylie.AI specializing in HTML, Tailwind, React, React Native, and JavaScript. Fixed multiple high-impact bugs, enhancing website efficiency and user experience. Implemented best practices in web development, focusing on scalability and accessibility.",
                icon: "fa fa-suitcase"
            },
            {
                title: "Incredible Escape Rooms",
                details: "Developed and managed secure servers for critical data, including security footage and customer contracts. Improved data protection through encryption, firewall setup, and Cloudflare integration. Streamlined document storage, optimizing performance and minimizing downtime.",
                icon: "fa fa-suitcase"
            },
            {
              title: "Education",
              details: "Arizona State University, Ira A. Fulton School of Engineering\nB.S, Computer Science (Software Engineering) Aug 2023 - May 2027\n- Recipient of Arizona Promise Grant Scholarship\n- New American University Scholar - Dean's Award List",
              icon: "fa fa-star"
            },
            {
              title: "HMMT",
              details: "Harvard-MIT Math Tournament\nInvited to compete at Harvard-MIT Math Tournament, it is one of the largest and most prestigious high school competitions in the world.",
              icon: "fa fa-plus"
            },
            {
              title: "MIT Science Bowl Invitational",
              details: "Massachusetts Institute of Technology Science Bowl Invitational\nInvited to compete at the MIT Science Bowl with 3 other teammates.",
              icon: "fa fa-flask"
            },
          ].map((item, index) => (
            <div className="flashcard" key={index}>
              <div className="flashcard-icon">
                <i className={item.icon}></i>
              </div>
              <div className="flashcard-content">
                <h3>{item.title}</h3>
                <p>{item.details.split('\n').map((line, i) => <span key={i}>{line}<br /></span>)}</p>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Timeline;
